public class Sessions extends Controller { public static void waitFor(Query query, long lastSessionId, List<Long> openSessionIds) { String clientId = request.remoteAddress; List<Session> sessions = query .with(new UpdatedSessions(lastSessionId, openSessionIds)) .execute(); Logger.info("%s -> Updated sessions since %s + %s: %s", clientId, lastSessionId, openSessionIds, sessions); while(sessions.isEmpty()) { List<Long> ids = await(MailBox.watch(query, clientId)); Logger.info("%s -> Received ids: %s", clientId, ids); sessions = query.with(new SessionIds(ids)).execute(); Logger.info("%s -> Queried sessions: %s", clientId, sessions); } Logger.info("%s -> Delivering %s", clientId, sessions); List<Tile> tiles = Tile.forGates(query.gates()); render(sessions, tiles); } } public class MailBox { private static List<Promise<List<Long>>> promises = Collections.synchronizedList(new ArrayList<Promise<List<Long>>>()); public static Future<List<Long>> watch(Query query, String clientId) { Logger.info("Mailbox.watch(%s, %s)", query, clientId); Promise<List<Long>> promise = new Promise<List<Long>>(); promises.add(promise); return promise; } public static void put(final long sessionId) { Logger.info("Mailbox.put(%s): promises=%s", sessionId, promises); if(promises.isEmpty()) return; final List<Promise<List<Long>>> targets = seizePromises(); new Thread() { @Override public void run() { // It's a list because we will accumulate ids before notifying the waiting clients List<Long> ids = Arrays.asList(sessionId); Logger.info("Mailbox.put(%s): target=%s", sessionId, targets); for(Promise<List<Long>> promise : targets) promise.invoke(ids); } }.start(); } private static List<Promise<List<Long>>> seizePromises() { List<Promise<List<Long>>> result = new ArrayList<Promise<List<Long>>>(); synchronized (promises) { result.addAll(promises); promises.clear(); } return result; } } 
